def twoSum(nums, target):
    """"""
    seen = {}
    unique_nums = []
    for (i, num) in enumerate(nums):
        if num not in seen:
            unique_nums.append(num)
            seen[num] = i
        if target - num in seen and seen[target - num] != i:
            return [seen[target - num], seen[num]]
    return None
